import math

def decode(i):
    return i % n        # Decodes the infinity string

def is_equal(a, b, start):
    j = start
    for i in range(0, k):
        if a[decode(j)] != b[i]:
            return False
        j += 1
    return True

def hash_of_b(b):
    h = 0
    for i in b:
        h += ord(i)
    return h

def hash_of_a(a):
    h = 0
    i = 0
    while i < k:
        h = h + ord(a[decode(i)])
        i += 1
    return h

def rhash(h, old, new):
    return h - ord(old) + ord(new)

def stringmatch(a,b):

    global k; k = len(b)            # These are global variables
    global n; n = len(a)
    hash_b = hash_of_b(b)
    rolling_hash = hash_of_a(a)

    for i in range(n):
        if rolling_hash == hash_b and is_equal(a, b, i):
                return math.ceil((i + k) / n)
        rolling_hash = rhash(rolling_hash, a[decode(i)], a[decode(i + k)])
    return -1



a = ""
b = ""


print(stringmatch(a, b))


